import React, { Component } from "react";

export default class Filter extends Component {
  render() {
    return (
      <div class="filter">
        <form>
          <div class="mb-3">
            <label for="exampleFormControlInput1" class="form-label">
              Name
            </label>
            <input
              type="email"
              class="form-control"
              id="exampleFormControlInput1"
              placeholder="name@example.com"
            />
          </div>
        </form>
      </div>
    );
  }
}
